        private async Task DoCRUDDBTest()
        {
            dbLocal.Database.BeginTransaction();
            // Post LocalInfrastructure
            var actionLocalInfrastructureAdded = await LocalInfrastructureDBService.Post(localInfrastructure);
            Assert.Equal(200, ((ObjectResult)actionLocalInfrastructureAdded.Result).StatusCode);
            Assert.NotNull(((OkObjectResult)actionLocalInfrastructureAdded.Result).Value);
            LocalInfrastructure localInfrastructureAdded = (LocalInfrastructure)((OkObjectResult)actionLocalInfrastructureAdded.Result).Value;
            Assert.NotNull(localInfrastructureAdded);

            // List<LocalInfrastructure>
            var actionLocalInfrastructureList = await LocalInfrastructureDBService.GetLocalInfrastructureList();
            Assert.Equal(200, ((ObjectResult)actionLocalInfrastructureList.Result).StatusCode);
            Assert.NotNull(((OkObjectResult)actionLocalInfrastructureList.Result).Value);
            List<LocalInfrastructure> localInfrastructureList = (List<LocalInfrastructure>)((OkObjectResult)actionLocalInfrastructureList.Result).Value;

            int count = ((List<LocalInfrastructure>)((OkObjectResult)actionLocalInfrastructureList.Result).Value).Count();
            Assert.True(count > 0);

            // List<LocalInfrastructure> with skip and take
            var actionLocalInfrastructureListSkipAndTake = await LocalInfrastructureDBService.GetLocalInfrastructureList(1, 1);
            Assert.Equal(200, ((ObjectResult)actionLocalInfrastructureListSkipAndTake.Result).StatusCode);
            Assert.NotNull(((OkObjectResult)actionLocalInfrastructureListSkipAndTake.Result).Value);
            List<LocalInfrastructure> localInfrastructureListSkipAndTake = (List<LocalInfrastructure>)((OkObjectResult)actionLocalInfrastructureListSkipAndTake.Result).Value;

            int countSkipAndTake = ((List<LocalInfrastructure>)((OkObjectResult)actionLocalInfrastructureListSkipAndTake.Result).Value).Count();
            Assert.True(countSkipAndTake == 1);

            Assert.False(localInfrastructureList[0].InfrastructureID == localInfrastructureListSkipAndTake[0].InfrastructureID);

            // Get LocalInfrastructure With InfrastructureID
            var actionLocalInfrastructureGet = await LocalInfrastructureDBService.GetLocalInfrastructureWithInfrastructureID(localInfrastructureList[0].InfrastructureID);
            Assert.Equal(200, ((ObjectResult)actionLocalInfrastructureGet.Result).StatusCode);
            Assert.NotNull(((OkObjectResult)actionLocalInfrastructureGet.Result).Value);
            LocalInfrastructure localInfrastructureGet = (LocalInfrastructure)((OkObjectResult)actionLocalInfrastructureGet.Result).Value;
            Assert.NotNull(localInfrastructureGet);
            Assert.Equal(localInfrastructureGet.InfrastructureID, localInfrastructureList[0].InfrastructureID);

            // Put LocalInfrastructure
            var actionLocalInfrastructureUpdated = await LocalInfrastructureDBService.Put(localInfrastructure);
            Assert.Equal(200, ((ObjectResult)actionLocalInfrastructureUpdated.Result).StatusCode);
            Assert.NotNull(((OkObjectResult)actionLocalInfrastructureUpdated.Result).Value);
            LocalInfrastructure localInfrastructureUpdated = (LocalInfrastructure)((OkObjectResult)actionLocalInfrastructureUpdated.Result).Value;
            Assert.NotNull(localInfrastructureUpdated);

            // Delete LocalInfrastructure
            var actionLocalInfrastructureDeleted = await LocalInfrastructureDBService.Delete(localInfrastructure.InfrastructureID);
            Assert.Equal(200, ((ObjectResult)actionLocalInfrastructureDeleted.Result).StatusCode);
            Assert.NotNull(((OkObjectResult)actionLocalInfrastructureDeleted.Result).Value);
            bool retBool = (bool)((OkObjectResult)actionLocalInfrastructureDeleted.Result).Value;
            Assert.True(retBool);

            dbLocal.Database.RollbackTransaction();
        }
        private async Task<bool> Setup(string culture)
        {
            Config = new ConfigurationBuilder()
               .SetBasePath(Directory.GetParent(AppContext.BaseDirectory).FullName)
               .AddJsonFile("appsettings_csspdbservicestests.json")
               .AddUserSecrets("91a273aa-0169-4298-82eb-86ff2429a2f8")
               .Build();

            Services = new ServiceCollection();

            Services.AddSingleton<IConfiguration>(Config);

            string CSSPDBConnString = Config.GetValue<string>("TestDB");
            Assert.NotNull(CSSPDBConnString);

            Services.AddDbContext<CSSPDBContext>(options =>
            {
                options.UseSqlServer(CSSPDBConnString);
            });

            Services.AddDbContext<ApplicationDbContext>(options =>
            {
                options.UseSqlServer(CSSPDBConnString);
            });

            Services.AddIdentityCore<ApplicationUser>()
                .AddEntityFrameworkStores<ApplicationDbContext>();
            /* ---------------------------------------------------------------------------------
             * using CSSPDBLocalContext
             * ---------------------------------------------------------------------------------      
             */
            string CSSPDBLocal = Config.GetValue<string>("CSSPDBLocal");
            Assert.NotNull(CSSPDBLocal);

            FileInfo fiCSSPDBLocal = new FileInfo(CSSPDBLocal);

            Services.AddDbContext<CSSPDBLocalContext>(options =>
            {
                options.UseSqlite($"Data Source={ fiCSSPDBLocal.FullName }");
            });

            Services.AddSingleton<ICSSPCultureService, CSSPCultureService>();
            Services.AddSingleton<ILocalService, LocalService>();
            Services.AddSingleton<IEnums, Enums>();
            Services.AddSingleton<ILocalInfrastructureDBService, LocalInfrastructureDBService>();

            Provider = Services.BuildServiceProvider();
            Assert.NotNull(Provider);

            CSSPCultureService = Provider.GetService<ICSSPCultureService>();
            Assert.NotNull(CSSPCultureService);

            CSSPCultureService.SetCulture(culture);

            LocalService = Provider.GetService<ILocalService>();
            Assert.NotNull(LocalService);

            string Id = Config.GetValue<string>("Id");
            Assert.True(await LocalService.SetLoggedInContactInfo());

            dbLocal = Provider.GetService<CSSPDBLocalContext>();
            Assert.NotNull(dbLocal);

            LocalInfrastructureDBService = Provider.GetService<ILocalInfrastructureDBService>();
            Assert.NotNull(LocalInfrastructureDBService);

            return await Task.FromResult(true);
        }
